import React, {BrowserRouter} from 'react';
import header from './header';
import home from './home';
import coin from './coin';

export default function App() {

  return (
      <BrowserRouter>
        <div className='App'>
          <header />
          <home />
          <coin />
        </div>
      </BrowserRouter>
  )
}
